import React from 'react'
import Project from './Project'
const List = () => {
    const projects = [
        {name: 'jorge'},
        {name: 'maria'},
        {name: 'no se'}
    ]
    return (
        <ul>
            {projects.map(project => (
                <Project project={project} />
            ))}
        </ul>
    )
}

export default List
